import { useNavigate } from "react-router";
import  {Helmet}  from  "react-helmet"
import { Link } from "react-router-dom";
import Footer from "../components/Footer";

function  Login(){

const [Username ,setUserName]=React.useState("");
const [password ,setPassword]=React.useState("");



const navigate=useNavigate();

function handlechange(event){


const {name ,value}=event.target;

(name==="Username")?setUserName(value):setPassword(value);
 
}


  function handleClick(event){


   navigate("./Home")
   console.log(Username);


   event.preventDefault();
  }





return (  
<div  className="container"> 
<Helmet>
        <link rel="stylesheet" href="login.css" />
</Helmet>
  <img className="circle-img" src="data:image/jpeg;base64, "alt="avatar_img" />
<h2>Task it : task managment made easy!{Username}</h2>
<form className="form">
<input  onChange={handlechange} name="Username" type="text" placeholder="Username" />
<input  onChange={handlechange} name="Password" type="password" placeholder="Password"  autoComplete=""/>
 
<button onClick={handleClick} type="submit">login</button>
<button ><Register></Register></button>
</form>  
 
</div>)


}


export default Login;
